import React from 'react';
import { Link } from 'react-router-dom';

class ProjectIndexItem extends React.Component {

  render() {
    // let temp_img = "data:image/jpeg;base64,"
    // let temp_img = "data:image/png;base64,"
    let temp_img = "data:image/jpeg;base64,"
    return (
      <div className='project-item'>
        <div className='project-image-container'>
          <Link to={`/api/projects/${this.props.projectId}`}>
            <img className='project-image' src={temp_img} />
          </Link>
        </div>
        <div className='project-index-text'>
          <Link to={`/api/projects/${this.props.projectId}`}>
            <li>
              <label className="project-index-title">{this.props.title}</label><br/>by {this.props.author}
            </li>
          </Link>
        </div>
      </div>
      );
  }
} 
export default ProjectIndexItem;